import React from 'react';

function Transaction({ transaction, index }) {
  return (
    <tr className="Transaction">
      <td>
        {transaction.date}
      </td>
      <td>
        <a href={`/transactions/${index}`}>{transaction.item_name}</a>
      </td>
      <td>
        {transaction.amount}
      </td>
    </tr>
  );
}

export default Transaction;
